import React from 'react';
// import SearchResults from './SearchResults';

const SearchResults = ({ titles }) => {
  return (
    <div>
      <h2>検索結果</h2>
      <ul>
        {titles.map(title => (
          <li key={title.id}>
            <a href={title.link}>{title.title}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

// export default SearchResults;


const App = () => {
  const titles = [
    { id: 1, title: 'タイトル1', link: 'https://example.com/page1' },
    { id: 2, title: 'タイトル2', link: 'https://example.com/page2' },
    { id: 3, title: 'タイトル3', link: 'https://example.com/page3' }
  ];

  return (
    <div>
      <h1>検索結果</h1>
      <SearchResults titles={titles} />
    </div>
  );
};

export default App;
